import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  return (

    <div className="grid-container">
      <header className="header">
        <div>Color Game</div>
      </header>

      <main className="main">
        <div className="ui grid">

        </div>
      </main>

      <footer className="footer">
        <div> Please Select Color box</div>
      </footer>
    </div>

  );
}

export default App;
